import React, { Component } from "react";

class NewItemContainer extends Component {
  constructor() {
    super();
    this.state = {
      image: "",
      title: "",
      description: "",
      price: "",
      quantity: ""
    };
  }

  render() {
    return <div></div>;
  }
}

export default NewItemContainer;
